package ont_dex

import (
	"encoding/hex"
	"fmt"
	"github.com/Ontology/common"
)

var (
	DExFundCode  = ""
	DExProtoCode = ""
	DEXP2PCode   = ""

	DExFundCodeHash         []byte
	DExFundCodeHashReverse  []byte
	DExProtoCodeHash        []byte
	DExProtoCodeHashReverse []byte
	DEXP2PCodeHash          []byte
	DEXP2PCodeHashReverse   []byte
)

func init() {
	DExFundCodeHash = getHashCode(DExFundCode)
	DExFundCodeHashReverse = getHashCodeReverse(DExFundCode)
	fmt.Printf("DExFundCodeHash: %x Reverse: %x\n", DExFundCodeHash, DExFundCodeHashReverse)
	DExProtoCodeHash = getHashCode(DExProtoCode)
	DExProtoCodeHashReverse = getHashCodeReverse(DExProtoCode)
	fmt.Printf("DExProtoCodeHash: %x Reverse: %x\n", DExProtoCodeHash, DExProtoCodeHashReverse)
	DEXP2PCodeHash = getHashCode(DEXP2PCode)
	DEXP2PCodeHashReverse = getHashCodeReverse(DEXP2PCode)
	fmt.Printf("DEXP2PCodeHash: %x Reverse: %x\n", DEXP2PCodeHash, DEXP2PCodeHashReverse)

	str := "1e8d779e5e5048910a44501fb13e09690fc75768"
	b, _ := hex.DecodeString(str)
	fmt.Printf("%x\n", b)
}

func getHashCodeReverse(code string) []byte {
	c, _ := common.HexToBytes(code)
	hashCode, _ := common.ToCodeHash(c)
	return hashCode.ToArrayReverse()
}

func getHashCode(code string) []byte {
	c, _ := common.HexToBytes(code)
	hashCode, _ := common.ToCodeHash(c)
	return hashCode.ToArray()
}
